import './App.css';
import NavScroll from "./NavBar.js";
import Landingpage from "./Landingpage.js";
import "./Landingpage.css";
import{BrowserRouter, Route, Router} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <div className="App yellow" >
      <NavScroll/>
      <Route to ="/" element={Landingpage}/>
    </div>
    </BrowserRouter>
  );
}

export default App;
